import{o as e,c as t,a}from"./app.88357bea.js";const s='{"title":"Ressource : Ajout d\'un Compte Bancaire","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. Description de la Resource","slug":"_1-description-de-la-resource"},{"level":2,"title":"2. URL et Méthode d\'accès","slug":"_2-url-et-methode-d-acces"},{"level":2,"title":"3. Paramètres","slug":"_3-parametres"},{"level":2,"title":"4. Requête réussie","slug":"_4-requete-reussie"},{"level":2,"title":"5. Cas d\'échec d\'une requête","slug":"_5-cas-d-echec-d-une-requete"}],"relativePath":"guide/services/bankaccount/store.md","lastUpdated":1626368992491}',n={},r=a('<h1 id="ressource-ajout-d-un-compte-bancaire"><a class="header-anchor" href="#ressource-ajout-d-un-compte-bancaire" aria-hidden="true">#</a> Ressource : Ajout d&#39;un Compte Bancaire</h1><hr><h2 id="_1-description-de-la-resource"><a class="header-anchor" href="#_1-description-de-la-resource" aria-hidden="true">#</a> 1. Description de la Resource</h2><p>Cette ressource permet d&#39;ajouter un compte bancaire pour un utilisateur.</p><h2 id="_2-url-et-methode-d-acces"><a class="header-anchor" href="#_2-url-et-methode-d-acces" aria-hidden="true">#</a> 2. URL et Méthode d&#39;accès</h2><p>Pour ajouter un compte bancaire pour un utilisateur quelconque, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /bank_account\n</code></pre></div><div class="danger custom-block"><p class="custom-block-title">Rappel</p><p>L&#39;accès aux données à cette ressource se fait via la méthode <strong><code>POST</code></strong></p></div><h2 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h2><p>Ci-dessous le tableau descriptif des paramètres de cette ressource :</p><table><thead><tr><th>paramètre</th><th style="text-align:center;">Type</th><th>Règle de validation</th><th style="text-align:center;">Description</th></tr></thead><tbody><tr><td>createdAt</td><td style="text-align:center;">datetime</td><td>Obligatoire (lors de la création et de la mise à jour)</td><td style="text-align:center;">Date de création</td></tr><tr><td>name</td><td style="text-align:center;">string</td><td>Obligatoire (lors de la création), <br> min=2 (lors de la création et de la mise à jour)</td><td style="text-align:center;">Nom de la banque</td></tr><tr><td>address</td><td style="text-align:center;">string</td><td>Obligatoire (lors de la création), <br> min=3 (lors de la création et de la mise à jour)</td><td style="text-align:center;">Adresse de la banque</td></tr><tr><td>code</td><td style="text-align:center;">string</td><td>Obligatoire (lors de la création), <br> min=3 (lors de la création et de la mise à jour)</td><td style="text-align:center;">Code française de la banque</td></tr><tr><td>iban</td><td style="text-align:center;">string</td><td>Format IBAN « International Bank Account Number » (en français : numéro de compte bancaire international) - lors de la création et de la mise à jour</td><td style="text-align:center;">Le numéro IBAN</td></tr><tr><td>bic</td><td style="text-align:center;">string</td><td>Format BIC (Bank Identifier Code) - lors de la création et de la mise à jour</td><td style="text-align:center;">Le numéro BIC</td></tr><tr><td>status</td><td style="text-align:center;">string</td><td>Valeurs à choisir : <strong>enabled, disabled</strong> - lors de la création et de la mise à jour</td><td style="text-align:center;">Le status</td></tr><tr><td>user</td><td style="text-align:center;">User (utilisateur)</td><td>Obligatoire</td><td style="text-align:center;">Référence le id de l&#39;utilisateur courant qui est le propriétaire du compte bancaire.</td></tr></tbody></table><h2 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h2><p>Lorsque la requête est validée avec succès, il s&#39;affichera un resultat de type suivant:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;id&quot;</span><span class="token operator">:</span> <span class="token number">64</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Banque Populaire&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;status&quot;</span><span class="token operator">:</span> <span class="token string">&quot;enabled&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;created_at&quot;</span><span class="token operator">:</span> <span class="token string">&quot;2021-07-12 16:14:15&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;code&quot;</span><span class="token operator">:</span> <span class="token string">&quot;53534234&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;address&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Boulevard Abdelkrim el khattabi, apt. 5&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;iban&quot;</span><span class="token operator">:</span> <span class="token null keyword">null</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;bic&quot;</span><span class="token operator">:</span> <span class="token null keyword">null</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;user_id&quot;</span><span class="token operator">:</span> <span class="token number">1</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_5-cas-d-echec-d-une-requete"><a class="header-anchor" href="#_5-cas-d-echec-d-une-requete" aria-hidden="true">#</a> 5. Cas d&#39;échec d&#39;une requête</h2><p>En cas d&#39;échec, Quand vous ne fournissez pas le nom de la banque par exemple, vous aurez un message de type:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Cette valeur ne doit pas être vide.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',17);n.render=function(a,s,n,o,d,l){return e(),t("div",null,[r])};export default n;export{s as __pageData};
